Stimularea dinamica electroneuronala se bazeaza pe actiunea asupra zonelor reflexogene si a punctelor de acupunctura ale corpului, prin scurte impusuri electrice si pe schimbarea dinamica a rezistentei electrice cu actiune reflexa in profunzime, ceea ce conduce la schimbari simptomatice, hemodinamice, si homeostazice, cu influentarea pozitiva a tuturor mecanismelor patogenetice avind ca rezultat final ameliorarea si vindecarea a numeroase boli fara folosirea de medicamente. Cu acest aparat pot fi tratate boli atat la adulti cat si copii, precum:
-Boli ale sistemului nervos central si periferic;
- Boli urogenitale: pielonefrite: litiaza urinara, glomerulonefrite, cistite, tulburari menstruale, sterilitatea, fibroame;
- Afectiuni musculo-scheletale: artoze, artrite, edeme, mialgii, traumatisme, vindecarea rapida a fracturilor;

Detalii la http://rovitalclinic.weebly.com/terapia-durerii.html

